import React from "react";
import { LoginForm } from "./components/form/form";
const App: React.FC = (props: any) => {
  const handleSubmit = (value: any) => {
    console.log(value);
  };
  return (
    <div className="App">
      <LoginForm onSubmit={handleSubmit} />
    </div>
  );
};

export default App;
